/**
 * Logout Success Page
 * Displayed after successful logout
 */

import React from 'react';
import { useNavigate } from 'react-router-dom';
import { CheckCircle } from 'phosphor-react';
import '../styles/Pages.css';

function LogoutSuccess() {
  const navigate = useNavigate();

  const handleLoginAgain = () => {
    navigate('/');
    window.location.reload(); // Force reload to trigger login
  };

  return (
    <div className="page-container" style={{
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)'
    }}>
      <div className="card" style={{
        maxWidth: '500px',
        width: '100%',
        padding: '3rem',
        textAlign: 'center',
        boxShadow: '0 10px 40px rgba(0,0,0,0.2)'
      }}>
        <div style={{ marginBottom: '2rem' }}>
          <CheckCircle size={80} weight="fill" color="#28a745" style={{
            animation: 'scaleIn 0.5s ease'
          }} />
        </div>

        <h1 style={{ marginBottom: '1rem', color: '#2c3e50' }}>Logout Berhasil</h1>
        <p style={{ fontSize: '1.1rem', color: '#6c757d', marginBottom: '2rem' }}>
          Anda telah berhasil keluar dari sistem PEMDA DIY Dashboard.
        </p>

        <div style={{
          background: '#f8f9fa',
          padding: '1.5rem',
          borderRadius: '8px',
          margin: '1.5rem 0'
        }}>
          <p style={{ margin: '0.5rem 0', color: '#6c757d' }}>
            Sesi Anda telah dihapus dengan aman.
          </p>
          <p style={{ margin: '0.5rem 0', color: '#6c757d' }}>
            Terima kasih telah menggunakan layanan kami.
          </p>
        </div>

        <button
          onClick={handleLoginAgain}
          className="btn-primary"
          style={{
            width: '100%',
            padding: '0.75rem',
            fontSize: '1rem',
            fontWeight: '600',
            marginTop: '1rem'
          }}
        >
          Login Kembali
        </button>

        <div style={{
          marginTop: '2rem',
          paddingTop: '1rem',
          borderTop: '1px solid #dee2e6',
          color: '#6c757d',
          fontSize: '0.9rem'
        }}>
          <p>Â© 2026 PEMDA DIY Dashboard</p>
        </div>
      </div>

      <style>{`
        @keyframes scaleIn {
          from { transform: scale(0); }
          to { transform: scale(1); }
        }
      `}</style>
    </div>
  );
}

export default LogoutSuccess;
